    .then(response => response.json())
    .then(json => {
      weatherData = json.forecast.forecastday
      we1 = weatherData.map(data => {
        console.log(data)
        return <WeatherTile main={data.date} />
      })
    })
  }
  render() {
    return(
      <div className="tile">
